records.addlTxt:
Plea hearing proceeds.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Amended Information and ordered a Judgment of Conviction be entered into the record.  

Sentencing proceeded.  Statements by the State, defense and defendant.

The Court imposed and stayed 4 months at the House of Correction, with credit for 3 days time served, and placed defendant on probation for one (1) year.

